pragma solidity^0.4.21;

import "./RentAndLeaseBase.sol";


// @dev 
contract RentAndLease is RentAndLeaseBase {

    constructor() public {
        ceoAddress = msg.sender;
    }


    // @dev 
    // @notice _renterapprove, token
    // @param _price    
    // @param _rentTime 
    // @param _renter   
    // @return index
    function rent(
        address _contract,
        uint256 _tokenId,
        uint256 _price,
        uint256 _rentTime,
        address _renter
        )
        external
        payable
        onlyWhitelisted
        whenNotPaused
        returns(bytes32)
    {
        require(_owns(_contract, _renter, _tokenId));   // token
        require(_rentTime >= 1 seconds);                 // 1s
        require(_price >= 0);
        require(_price == uint128(_price));             // 
        // _escrow(_contract, _renter, _tokenId);       //  ====  ====

        Rent memory newrent = Rent(_contract, _tokenId, _renter, address(0),  _price, _rentTime, now);
        return _creatRent(_contract, _tokenId, newrent);
    }

    // @dev token
    // @param  _leaser  
    function lease(
        address _contract,
        uint256 _tokenId,
        address _leaser,
        uint256 _sendAmount
        )
        external
        payable
        onlyWhitelisted
        whenNotPaused
        returns(
            bool,
            uint256,
            address,
            uint256,
            uint256,
            uint256
            )
    {
        bytes32 index = _computeIndex(_contract, _tokenId);
        Rent storage _rent = IndexToRent[index];
        require(_sendAmount >= _rent.price);
        require(_isOnRent(IndexToRent[index]));
        return _lease(_contract,_tokenId, _sendAmount, _leaser);
    }


    // @dev 
    // @param  _contract  
    // @param  _tokenId   tokenId
    // @return    
    function getRentInfo(
        address _contract,
        uint256 _tokenId
        )
        external
        view
        returns
        (
            address,
            uint256,
            uint256,
            uint256
        )
    {
        bytes32 index = _computeIndex(_contract, _tokenId);
        require(_isOnRent(IndexToRent[index]));                 // 
        Rent storage _rent = IndexToRent[index];
        return (_rent.renter, _rent.price, _rent.beginTime, _rent.rentTime);
    }


    // @dev 
    // @param  _renter 
    function cancelRent(
        address _contract,
        uint256 _tokenId,
        address _renter
        )
        external
        onlyWhitelisted
    {
        bytes32 index = _computeIndex(_contract, _tokenId);
        // require(_owns(_contract, _renter,_tokenId));    // _renter  token
        require(_isOnRent(IndexToRent[index]));         // token 
        _cancelRent(_contract, _tokenId, _renter);      // 
    }

    // @dev 
    // @param _price  
    // @param rentTime 
    function setPriceAndTime(
        address _contract,
        uint256 _tokenId,
        uint256 _price,
        uint256 _rentTime,
        address _renter
        )
        external
        onlyWhitelisted
    {
        require(_price == uint128(_price));
        require(_price > 0);
        require(_rentTime > 1 seconds);
        _reset(_contract, _tokenId, _price, _rentTime, _renter);
    }


    function rentFinish(address _contract, uint256 _tokenId) external onlyWhitelisted {
        _rentFinish(_contract,_tokenId);
    }

    // @dev 
    // @ param  _ownercut 
    function setFees(uint256 _ownercut) external  {
        rentCut = _ownercut;
    }

    function getFees() external view returns(uint256) {
        return rentCut;
    }

    function getRenter(address _contract, uint256 _tokenId) external view returns(address) {
        bytes32 index = _computeIndex(_contract, _tokenId);
        return IndexToRent[index].renter;
    }

}
